import { INamedEntity } from './../Interfaceses/INamedEntity'

export let formatter = (data: Array<string>) => {
  let res = data.slice(0, -1).map((element) => `${element},`)
  return res.push(data[data.length - 1])
}
export let formatterObject = (data: Array<INamedEntity>) => {
  let res = data.slice(0, -1).map((element) => `${element.name},`)
  return res.push(data[data.length - 1].name)
}
